INSERT INTO wartech.LEVEL_CRITERIA (name,maxScore,description,createdAt,updatedAt,deletedAt,RUBRICCRITERIumId) VALUES
	 ('Nivel deseado',2.0,'<p>El alumno indica el t&iacute;tulo de la tesis que realizar&aacute;.&nbsp;</p>','2022-11-30 04:51:20','2022-11-30 04:51:20',NULL,1),
	 ('Nivel deseado',8.0,'<p>El alumno indica el nombre completo de su asesor e especifica el<br>plan de trabajo que desarrollar&aacute; con el asesor para garantizar que&nbsp;consiga cumplir con los objetivos del curso. El alumno informa el&nbsp;cronograma de reuniones con el asesor.</p>','2022-11-30 04:52:35','2022-11-30 04:52:35',NULL,2),
	 ('Nivel deseado',2.0,'<p>El alumno identifica claramente a qu&eacute; &aacute;rea corresponde el proyecto&nbsp;de fin de carrera</p>','2022-11-30 04:53:35','2022-11-30 04:53:35',NULL,3),
	 ('Nivel deseado',8.0,'<p>El alumno describe claramente la idea que proyecto de fin de carrera. Esta es una descripci&oacute;n responde a las preguntas:</p>
INSERT INTO wartech.LEVEL_CRITERIA (name,maxScore,description,createdAt,updatedAt,deletedAt,RUBRICCRITERIumId) VALUES
	 ('Nivel deseado',2.0,'<p>Cobertura de conceptos: por lo menos todos los conceptos presentados en la problem&aacute;tica han sido incluidos en el marco. Detalle&nbsp;de conceptos: Deben detallarse los conceptos de una forma m&aacute;s amplia que en la problem&aacute;tica. En algunos casos para comprender los conceptos es necesario incluir ejemplos. En caso de ser necesario usar ejemplo, estos deber&aacute;n ser reales y basados en la problem&aacute;tica.</p>','2022-11-30 16:25:38','2022-11-30 16:25:38',NULL,11),
	 ('Nivel deseado',5.0,'<p>El alumno explica de forma resumida el m&eacute;todo empleado para la&nbsp;revisi&oacute;n. El alumno ha realizado una revisi&oacute;n extensa de las fuentes que son relevantes para el desarrollo de su proyecto de tesis.&nbsp;Realiza una apropiada citaci&oacute;n de los estudios m&aacute;s pertinentes&nbsp;en el campo, incluyendo art&iacute;culos cient&iacute;ficos y tesis previamente realizadas. En el caso de proyectos enfocados al desarrollo de software, establece un an&aacute;lisis comparativo de productos similares&nbsp;que existen en el mercado, e indica los aspectos que diferencian a&nbsp;su propuesta, justificando en base a esta revisi&oacute;n que su proyecto&nbsp;es innovador, original, correcto, novedoso y suficientemente complejo como para ser un proyecto de tesis de pregrado. Establece&nbsp;una excelente s&iacute;ntesis y organizaci&oacute;n de la literatura que est&aacute; claramente vinculada al problema de investigaci&oacute;n. El alumno utiliza&nbsp;la revisi&oacute;n de la literatura para fundamentar el desarrollo de su&nbsp;propuesta de tesis (pone en evidencia el vac&iacute;o a ser cubierto por&nbsp;el trabajo de tesis).</p>','2022-11-30 16:26:17','2022-11-30 16:26:17',NULL,12),
	 ('Nivel deseado',5.0,'<p>La redacci&oacute;n es fluida, clara, concisa y entendible. La gram&aacute;tica y<br>ortograf&iacute;a son correctas. No hay errores. Existe transiciones claras<br>entre cap&iacute;tulos y p&aacute;rrafos (o cualquier divisi&oacute;n que se utilice).<br>Se aplica apropiadamente el formato de citaci&oacute;n en el texto y<br>bibliograf&iacute;a, as&iacute; como referencias correctamente descritas en todo&nbsp;el documento.</p>','2022-11-30 16:26:51','2022-11-30 16:26:51',NULL,13),
	 ('Nivel deseado',4.0,'<p>El alumno contextualiza claramente el problema, respaldando y<br>justificando fuertemente la ejecuci&oacute;n de su proyecto de tesis, el<br>cual tiene como objetivo desarrollar una propuesta de soluci&oacute;n a<br>la problem&aacute;tica que ha sido identificada. El problema a solucionar&nbsp;debe ser relevante y de la magnitud de un proyecto de fin de&nbsp;carrera.</p>','2022-11-30 16:31:26','2022-11-30 16:31:26',NULL,14),
	 ('Nivel deseado',2.0,'<p>Cobertura de conceptos: por lo menos todos los conceptos presentados en la problem&aacute;tica han sido incluidos en el marco. Detalle&nbsp;de conceptos: Deben detallarse los conceptos de una forma m&aacute;s&nbsp;amplia que en la problem&aacute;tica. En algunos casos para comprender los conceptos es necesario incluir ejemplos. En caso de ser&nbsp;necesario usar ejemplo, estos deber&aacute;n ser reales y basados en la&nbsp;problem&aacute;tica.</p>','2022-11-30 16:31:50','2022-11-30 16:31:50',NULL,15),
	 ('Nivel deseado',2.0,'<p>El alumno explica de forma resumida el m&eacute;todo empleado para la&nbsp;revisi&oacute;n. El alumno ha realizado una revisi&oacute;n extensa de las fuentes que son relevantes para el desarrollo de su proyecto de tesis.&nbsp;Realiza una apropiada citaci&oacute;n de los estudios m&aacute;s pertinentes&nbsp;en el campo, incluyendo art&iacute;culos cient&iacute;ficos y tesis previamente&nbsp;realizadas. En el caso de proyectos enfocados al desarrollo de software, establece un an&aacute;lisis comparativos de productos similares&nbsp;que existen en el mercado, e indica los aspectos que diferencian a&nbsp;su propuesta, justificando en base a esta revisi&oacute;n que su proyecto&nbsp;es innovador, original, correcto, novedoso y suficientemente complejo como para ser un proyecto de tesis de pregrado. Establece&nbsp;una excelente s&iacute;ntesis y organizaci&oacute;n de la literatura que est&aacute; claramente vinculada al problema de investigaci&oacute;n. El alumno utiliza&nbsp;la revisi&oacute;n de la literatura para fundamentar el desarrollo de su&nbsp;propuesta de tesis (pone en evidencia el vac&iacute;o a ser cubierto por&nbsp;el trabajo de tesis).</p>','2022-11-30 16:32:37','2022-11-30 16:32:37',NULL,16),
